import React from 'react';
import './App.css';
import { Routes, Route } from 'react-router-dom';
import SignIn from './pages/SignIn';
import SelectBad from './pages/SelectBad';
import SelectGood from './pages/SelectGood';



function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/signin' element={<SignIn/>}/>
        <Route path='/selectBad' element={<SelectBad/>}/>
        <Route path='selectGood' element={<SelectGood/>}/>
      </Routes>
    </div>
  );
}

export default App;
